import { changePassword } from "@/api/user"
export default {
  components: {},
  props: [],
  data() {
    return {
      formData: {
        old_password: undefined,
        new_password1: undefined,
        new_password2: undefined,
      },
      rules: {
        old_password: [{
          required: true,
          message: '请输入旧密码',
          trigger: 'blur'
        }],
        new_password1: [{
          required: true,
          message: '请输入新密码',
          trigger: 'blur'
        }],
        new_password2: [{
          required: true,
          message: '请再次输入新密码',
          trigger: 'blur'
        }],
      },
    }
  },
  computed: {},
  watch: {},
  created() {},
  mounted() {},
  methods: {
    submitForm() {
      this.$refs['elForm'].validate(valid => {
        if (!valid) return
        // TODO 提交表单
        changePassword(this.formData).then(async(res)=>{
            this.$message({
          message: '密码修改成功,请重新登陆',
          type: 'success'
        })
        await this.$store.dispatch('user/logout')
        this.$router.push(`/login`)
        })
      })
    },
    resetForm() {
      this.$refs['elForm'].resetFields()
    },
  }
}
